import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import PaginaPrincipal from './componentes/PaginaPrincipal';
import PaginaPortfolio from './componentes/PaginaPortfolio';
import Home from './componentes/Home/Home';
import SobreEmpresa from './componentes/SobreEmpresa/SobreEmpresa';
import Servicos from './componentes/Servicos/Servicos';
import Projetos from './componentes/Projetos/Projetos';
import Contato from './componentes/Contato/Contato';
import HomePortfolio from './componentes/Portfolio/HomePortfolio/HomePortfolio';
import SobreMim from './componentes/Portfolio/SobreMim/SobreMim';
import CompetenciaPortfolio from './componentes/Portfolio/CompetenciaPortfolio/CompetenciaPortfolio';
import ProjetosPortfolio from './componentes/Portfolio/ProjetosPortfolio/ProjetosPortfolio';
import ContatoPortfolio from './componentes/Portfolio/ContatoPortfolio/ContatoPortfolio';
import {Fa0} from "react-icons/fa6";
import Footer from "./pages/footer/Footer";
import Navbar from "./pages/Navbar";

function App() {
    return (
        <Router>
            <Navbar />
            <div className="content">

                <Routes>
                    <Route path="/home" element={<Home />} />
                    <Route path="/sobreEmpresa" element={<SobreEmpresa />} />
                    <Route path="/servicos" element={<Servicos />} />
                    <Route path="/projetos" element={<Projetos />} />
                    <Route path="/contato" element={<Contato />} />
                    <Route path="/homePortfolio" element={<HomePortfolio />} />
                    <Route path="/sobreMim" element={<SobreMim />} />
                    <Route path="/competenciaPortfolio" element={<CompetenciaPortfolio />} />
                    <Route path="/projetosPortfolio" element={<ProjetosPortfolio />} />
                    <Route path="/contatoPortfolio" element={<ContatoPortfolio />} />
                </Routes>
            </div>
            <Footer/>
        </Router>
    );}

export default App;



